import "./style.css";
import {
  Layout,
  Card,
  Input,
  Col,
  Row,
  Select,
  InputNumber,
  DatePicker,
  AutoComplete,
  Cascader,
} from "antd";
import { Typography } from "antd";

const { Title } = Typography;
const gridStyle = {
  width: "100%",
  textAlign: "center",
};
const { Content } = Layout;
const { Option } = Select;

const options = [
  {
    value: "zhejiang",
    label: "Zhejiang",
    children: [
      {
        value: "hangzhou",
        label: "Hangzhou",
        children: [
          {
            value: "xihu",
            label: "West Lake",
          },
        ],
      },
    ],
  },
  {
    value: "jiangsu",
    label: "Jiangsu",
    children: [
      {
        value: "nanjing",
        label: "Nanjing",
        children: [
          {
            value: "zhonghuamen",
            label: "Zhong Hua Men",
          },
        ],
      },
    ],
  },
];

const ThongTinHD = () => {
  return (
    <Layout>
      <Content>
        <div className="site-input-group-wrapper">
          <div className="site-card-border-less-wrapper">
            <Card title="Thông Tin Hóa Đơn" bordered={false} style={{ width: 1100 }}>
              <Input.Group size="medium">
                <Row gutter={8}>
                  <Col span={5}>
                    <Input defaultValue="Mã Hóa Đơn" />
                    <Input defaultValue="Ngày lập Hóa Đơn" />
                    <Input defaultValue="0571" />
                  </Col>
                  <Col span={8}>
                    <Input defaultValue="26888888" />
                    <Input defaultValue="26888888" />
                    <Input defaultValue="0571" />
                  </Col>
                </Row>
              </Input.Group>
            </Card>
          </div>
          ,
          <div>
            <Title level={3}>Thông Tin Hóa Đơn</Title>
          </div>
          <br />
          <Input.Group size="medium">
            <Row gutter={8}>
              <Col span={5}>
                <Input defaultValue="0571" />
              </Col>
              <Col span={8}>
                <Input defaultValue="26888888" />
              </Col>
            </Row>
          </Input.Group>
          <br />
        </div>
      </Content>
    </Layout>
  );
};
export default ThongTinHD;
